import {useState} from 'react';
const Home = () => {

    const [count, setCount] = useState(1);
    const event = () => {
        setCount(count+1);
    }
    
    return ( 
        <div className="home">
            <h2>Homepage - Drawings</h2>
            <button onClick={event}>Click here.</button>
            <br></br>
            <p>{count}</p>
        </div>
     );
}
 
export default Home;
